import React, { Component, Fragment } from 'react';
// import PropTypes from 'prop-types';
// import Select from 'react-select';
// import data from '../_data/data.json';


export class Table extends Component {
  constructor(props) {
    super(props)
    this.state = {
      selectedMentor: null,
    }
  }
  
  render() {
    let students ='';
    // const { selectedMentor} = this.state;
    const {data, mentor} = this.props
    if (data && mentor) {
// console.log(mentor);
// console.log(data.mentors[Object.keys(data.mentors)[5]]);
   
    const selectInfoMenter = data.mentors[mentor];
    
    students = <tr key={selectInfoMenter.id}>{selectInfoMenter.students.map(stud=> <td><a href = {stud.linkGithub}>{stud.name}</a></td>).join('')}</tr>;
    // const tableStudents = data.tasks.map((item) => 
    // <tr key={item.id}>{data.mentors[mentor].students
    //   .map( value => <td className={value.tasks[item.name].className}>1234</td>)
    //   .join('')}</tr>
    // );
    }

    else students = <tr><td>"Gecnj"</td></tr>;

    return (
        <Fragment>
        <table><tbody>{ students }</tbody></table>
        </Fragment>
    );
  }
}
